import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const colors = theme.palette.colors;

  return {
    container: {
      width: "100vw"
    },
    logoContainer: {
      display: "flex",
      flexDirection: "row",
      padding: 5
    },
    logo: {
      fontSize: "40px"
    },
    name: {
      color: "white",
      marginLeft: 5,
      fontSize: "30px"
    },
    siteLinks: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center"
    },
    link: {
      color: "white",
      textDecoration: "none",
      marginRight: 10,
      "&:hover": {
        cursor: "pointer"
      }
    }
  };
});
